import React from 'react';
import { 
    IonButton,
    IonButtons,
    IonHeader,
    IonIcon,
    IonTitle,
    IonToolbar
} from '@ionic/react';
import { returnUpBack } from 'ionicons/icons';


const SettingsTopBar: React.FC = () => (
    <IonHeader>
        <IonToolbar>
            <IonTitle>Settings</IonTitle>
            <IonButtons slot="end">
                <IonButton>
                    <IonIcon slot="icon-only" icon={returnUpBack}></IonIcon>
                </IonButton>
            </IonButtons>
        </IonToolbar>
    </IonHeader>
)

export default SettingsTopBar;
